desc:
Cannot be Special Summoned. When this card is Normal Summoned: You can target 1 of your banished Level 4 or lower "Blackwing" monsters; Special Summon it in Defense Position. You can banish this card from the GY to activate 1 of the following effects;
● Place Black Feather Counter(s) on 1 "Black-Winged Dragon" you control, equal to the number of card(s) your opponent controls.
● Place 1 Wedge Counter on each face-up monster your opponent controls that does not have one.

Cannot be used as a Synchro Material. Up to twice per turn: You can target 1 "Constellar" monster on the field, then activate 1 of these effects;
● Increase its Level by 1.
● Reduce its Level by 1.

Up to twice per turn, if this card was Special Summoned by the effect of a "Dododo" monster this turn: You can target 1 "Dododo" monster you control, then activate 1 of these effects;
● Increase its Level by 1.
● Reduce its Level by 1.

When this card inflicts battle damage to your opponent: You can activate 1 of these effects;
● Discard 1 random card from their hand.
● Send the top 2 cards of their Deck to the GY.

You can only use the effect of "Gimmick Puppet Egg Head" once per turn. You can discard 1 "Gimmick Puppet" monster, then activate 1 of these effects;
● Inflict 800 damage to your opponent.
● This card's Level becomes 8 until the End Phase.

You can banish this card from your Graveyard to activate 1 of these effects;
● Increase the Levels of all "Mermail" monsters you currently control by 1.
● Increase the Levels of all "Mermail" monsters you currently control by 2.

If this card is Normal or Special Summoned: You can add 1 "Vanquish Soul" Spell/Trap from your Deck to your hand. (Quick Effect): You can reveal the appropriate monster(s) in your hand to activate 1 of these effects;
● 1 DARK monster: 1 face-up monster your opponent controls loses 500 ATK/DEF.
● 1 DARK and 1 EARTH monster: Return 1 face-up monster on the field with the lowest DEF to the hand (your choice, if tied). You can only use each effect of "Vanquish Soul - Dr. Madlove" once per turn, and you cannot activate them in the same Chain.

If you control no monsters in the Main Monster Zone: You can Special Summon this card from your hand. (Quick Effect): You can reveal the appropriate monster(s) in your hand to activate 1 of these effects;
● 1 EARTH monster: This card cannot be destroyed by battle this turn.
● 1 EARTH and 1 FIRE monster: Destroy all Spells and Traps in this card's column. You can only use each effect of "Vanquish Soul - Panthera" once per turn, and you cannot activate them in the same Chain.
